/**
 * @title MentaportVerify
 * @dev Contract allows function to be restricted to users that posess 
 * signed authorization from the owner of the contract. This signed
 * message includes the user to give permission to and the contract address to prevent
 * reusing the same authorization message on different contract with same owner. 
**/

contract MentaportVerify is Ownable {

  modifier onlyValidMessage(uint _timestamp, uint256 _token, uint8 _v, bytes32 _r, bytes32 _s) 
  {
    //require timestamp valid
    require(isValidAccessMessage(msg.sender,_timestamp,_token,_v,_r,_s), "Wrong signature");
    _;
  }

  //----------------------------------------------------------------------------
  // Public functions that are View
  // Verifies if message was signed by owner to give access to _add for this contract.
  function isValidAccessMessage(
    address _address,
    uint _timestamp,
    uint256 _token,
    uint8 _v, 
    bytes32 _r, 
    bytes32 _s) 
    view public returns (bool)
  {
    bytes32 _hashedMessage = keccak256(abi.encodePacked(address(this), _address, _timestamp, _token));
    bytes memory prefix = "\x19Ethereum Signed Message:\n32";
    bytes32 prefixedHashMessage = keccak256(abi.encodePacked(prefix, _hashedMessage));
    address signer = ecrecover(prefixedHashMessage, _v, _r, _s);
    if (signer == owner()) {
      return true;
    }

    return false;
  }
}

